`,n.jsx(e.p,{children:"This project was born from a desire to challenge long-standing assumptions about how players interact with narrative and consequence in games. Many titles treat the ability to alter or revisit past events as purely mechanical convenience, disconnected from the world's fiction. I wanted to explore what happens when that interaction becomes a primary axis play -- when the act of shaping history is woven directly into the player's relationship with the story, the world, and its characters. My influences span literary works that play with structure and unreliable timelines, immersive sims with deeply reactive systems, and narrative-driven adventures where choices carry long-term weight. The goal is to bridge the gap between systemic interactivity and emotional storytelling, developing an experience where mechanical actions and narrative consequences are inseparable."}),`
