`,n.jsxs(e.p,{children:[n.jsx(e.em,{children:"Ganymede"})," is a first-person spell-based capture-the-flag prototype, built in Unreal Engine 5 for networked multiplayer with AI-controlled bots. The design focus was on tactical utility and battlefield control over pure mechanical aiming."]}),`
`,n.jsx(e.p,{children:"The first version was made entirely in Blueprint for speed of iteration. The second iteration was rebuilt in C++ and the Gameplay Ability System (GAS) to support improved networking, modularity, and performance."}),`
`,n.jsx(e.h2,{children:"The Challenge"}),`
`,n.jsx(e.p,{children:'I wanted to test how FPS design changes when direct-damage weapons are de-emphasized in favor of abilities that manipulate space, timing, and information. Capture-the-flag provides a natural structure for that -- it forces teamwork, creates evolving objectives, and gives bots a reason to coordinate beyond just "shoot the enemy."'}),`
`,n.jsx(e.p,{children:"On the technical side, I challenged myself to:"}),`
`,n.jsxs(e.ul,{children:[`
`,n.jsx(e.li,{children:"Build a modular ability system that designers could extend without rewriting core code."}),`
`,n.jsx(e.li,{children:"Create AI bots capable of basic CTF play: grabbing the flag, escorting, defending, and opportunistically engaging enemies."}),`
`,n.jsx(e.li,{children:"Support multiplayer replication in a way that felt responsive despite the complexity of abilities."}),`
`,n.jsx(e.li,{children:"Exercise my less-developed abilities in level design."}),`
`]}),`
