`,n.jsx(e.h3,{children:"Early Prototyping"}),`
`,n.jsx(e.p,{children:'The earliest prototypes were quick Blueprint experiments -- simple projectile abilities, rough maps, and placeholder AI logic. This phase was less about polish and more about proving that "spells instead of guns" could support real FPS flow.'}),`
