`,n.jsx(e.h3,{children:"Why CTF?"}),`
`,n.jsx(e.p,{children:"Capture-the-flag gave me built-in tactical layers: route guarding, trap setting, flanking, and defending. In contrast, a deathmatch setup would've pushed players toward brute-force damage racing. For bots, CTF also created clearer roles -- attacking, defending, escorting -- which aligned with my AI goals."}),`
