`,n.jsxs(e.li,{children:[n.jsx(e.strong,{children:"Replication code"}),": My first pass at multiplayer networking was fragile. I underestimated Unreal's replication complexity, which led to brittle solutions under a limited scope. This, however, pushed me to use GAS with built-in replication, which ultimately proved valuable."]}),`
`,n.jsxs(e.li,{children:[n.jsx(e.strong,{children:"AI scope"}),": I aimed for bots that could feel like teammates, but their combat behaviors remained simplistic. They didn't react well to status effects or disruptive abilities, which limited believability. Still, as my first venture into game AI, I gained significant strides in my understanding of it."]}),`
`,n.jsxs(e.li,{children:[n.jsx(e.strong,{children:"Architecture debt"}),": Starting in Blueprint (then further bolting AI onto character controllers) created maintainability issues that required significant refactoring. This was a good learning experience, but some systems should have been built with better solutions from the start."]}),`
`,n.jsxs(e.li,{children:[n.jsx(e.strong,{children:"Content scope"}),": Only a handful of spells were ever fully implemented, leaving much of the intended tactical diversity unexplored. My initial goal to explore this FPS design space, while a success, still has more that can be done."]}),`
