`,n.jsxs(e.li,{children:[n.jsx(e.strong,{children:"Prototype first, refactor early"}),": Rapid iteration is valuable, but delaying an architectural reset makes later changes harder. For anything networked or extensible, C++ and GAS should have been the starting point, not a rewrite."]}),`
`,n.jsxs(e.li,{children:[n.jsx(e.strong,{children:"Scope AI realistically"}),": Strong game rules can carry weak AI, but overscoping AI ambitions without early planning and robust tooling undermines credibility."]}),`
